import { StyledCalculator } from "./styles";
import Button from "../Button/Button";
import Display from "../Display/Display";

const Calculator = () => {
  return (
    <StyledCalculator>
      <Display value="100" />
      <Button label="AC" />
      <Button label="/" />
      <Button label="7" />
      <Button label="8" />
      <Button label="9" />
      <Button label="*" />
      <Button label="4" />
      <Button label="5" />
      <Button label="6" />
      <Button label="-" />
      <Button label="1" />
      <Button label="2" />
      <Button label="3" />
      <Button label="." />
      <Button label="0" />
      <Button label="=" />
      <Button label="+" />
    </StyledCalculator>
  );
};

export default Calculator;
